import React from 'react';
import { List, Card, Row, Col } from 'antd';

// Mock movie data with additional properties
const movieData = [
  { 
    id: 1, 
    title: 'Movie 1',
    name: 'Movie Name 1',
    cast: 'Actor 1, Actress 1',
    category: 'Action',
    budget: '$10M',
    releaseDate: '2022-01-01'
  },
  { 
    id: 2, 
    title: 'Movie 2',
    name: 'Movie Name 2',
    cast: 'Actor 2, Actress 2',
    category: 'Drama',
    budget: '$15M',
    releaseDate: '2022-02-15'
  },
  // ... Add more movies with properties
];

function ListComponent() {
  return (
    <div style={{ padding: '20px' }}>
      <Row gutter={16}>
        <List
          grid={{ gutter: 16, column: 3 }}
          dataSource={movieData}
          renderItem={(item) => (
            <List.Item>
              <Card title={item.name} style={{ width: '100%' }}>
                <p><strong>Title:</strong> {item.title}</p>
                <p><strong>Cast:</strong> {item.cast}</p>
                <p><strong>Category:</strong> {item.category}</p>
                <p><strong>Budget:</strong> {item.budget}</p>
                <p><strong>Release Date:</strong> {item.releaseDate}</p>
                {/* You can add more movie details here if needed */}
              </Card>
            </List.Item>
          )}
        />
      </Row>
    </div>
  );
}

export default ListComponent;
